import React from 'react';

const NewTodo: React.FC = () => {
    return (
        <form action="">
            <div>
                <label htmlFor="todo-text">Todo Text</label>
                <input type="text" id="todo-text" />
            </div>
            <button>Add Todo</button>
        </form>
    )
}

export default NewTodo;
